$(document).ready(function(){
	var message = "---Holy Mountain - Accessibility module loaded.---";
	$('html').hm_console_log(message);
});



/********************************************

META TAGS CHECK

********************************************/
$(document).ready(function(){
	

	/***** TITLE TAG CHECK *****/
		if ($("title").length) {
			//do nothing
		}else{
			
			var message = 'HTML [title] Meta missing';
			$('html').hm_console_log(message);

		}

	/***** DESCRIPTION TAG CHECK *****/
		if ($("meta[name='description']").length ){
			//do nothing
		}else if ($("meta[name='description']").attr("description") == "" ) {
			
			var message = 'HTML [description] meta missing';
			$('html').hm_console_log(message);

		}else{
			
			var message = 'HTML [description] meta missing';
			$('html').hm_console_log(message);

		}

	/***** CHARSET TAG CHECK *****/
		if ($("meta[charset]").length ){
			//do nothing
		}else if ($("meta[name='charset']").attr("charset") == "" ) {
			
			var message = "HTML [charset] meta missing";
			$('html').hm_console_log(message);

		}else if ($("meta[name='charset']").attr("charset") != "UTF-8" || $("meta[name='charset']").attr("charset") != "utf-8" ) {
			
			var message = "HTML [charset] meta missing";
			$('html').hm_console_log(message);

		}else{
			
			var message = "HTML [charset] meta missing";
			$('html').hm_console_log(message);

		}

	/***** VIEWPORT TAG CHECK *****/
		if ($("meta[name='viewport']").length) {
			//do nothing
		}else{
			
			var message = "HTML [viewport] meta missing";
			$('html').hm_console_log(message);
		}

	/***** LANG ATTRIBUTE CHECK *****/
		if ($("html").has().attr("lang") ){
			//do nothing
		}else if ($("html").attr("lang") != "" ) {
			//do nothing
		}else{
			
			var message = "HTML [lang] attribute missing";
			$('html').hm_console_log(message);
		}


});



/********************************************

FORM FIELDS CHECK

********************************************/
$(document).ready(function(){
	

	/***** FORM ATTRIBUTES CHECK *****/
		if ($("form").length) {
			$("form").each(function(){
			
				//method
					if ($(this).attr('method') != "") {
						//do nothing
					}else {
						$(this).addClass('--hm_form_method_missing');
						
						var message = 'Missing form method found. Search for "--hm_form_method_missing".';
						$('html').hm_console_log(message);
					}

				//action
					if ($(this).attr('action') != "") {
						//do nothing
					}else {
						$(this).addClass('--hm_form_action_missing');
						
						var message = 'Missing form action found. Search for "--hm_form_action_missing".';
						$('html').hm_console_log(message);
					}

				//id
					if ($(this).attr('id') != "") {
						//do nothing
					}else {
						$(this).addClass('--hm_form_id_missing');
						
						var message = 'Missing form ID found. Search for "--hm_form_id_missing".';
						$('html').hm_console_log(message);
					}
			});

		}

	/***** INPUT ATTRIBUTE CHECK *****/
		if ($("input").length) {
			$("input").each(function(){
			
				//name
					if ($(this).attr('name') != "") {
						//do nothing
					}else {
						$(this).addClass('--hm_input_name_missing');
						
						var message = 'Missing form method found. Search for "--hm_input_name_missing".';
						$('html').hm_console_log(message);
					}

				//id
					if ($(this).attr('id') != "") {
						//do nothing
					}else {
						$(this).addClass('--hm_form_id_missing');
						
						var message = 'Missing input ID found, likely missing label. Search for "--hm_form_id_missing".';
						$('html').hm_console_log(message);
					}
			});

		}

});



/********************************************

KEYBOARD CONTROLS

********************************************/

	/***** KEYBOARD CLICK/ENTER KEY *****/
		$(document).ready(function(){
			
			var focused = $(':focus');

			$(document).keyup(function(e) {
			  if (e.keyCode == HolyMountain_keyboard.enter_key){
			  	e.preventDefault();
			  	$(focused).click();
			  }
			});
		});




/********************************************

ALT TAG FALLBACK

********************************************/

$(document).ready(function(){

	$('img:not(img[alt])').each(function(){
		var img_src = $(this).attr('src');
		$(this).attr('alt', '');
		$(this).addClass('--hm_alt_tag_missing');
		
		var message = 'Missing alt tag found - src: '+img_src+'. Search for "--hm_alt_tag_missing".';
		$('html').hm_console_log(message);
	});
	
});


/********************************************

LINK FORMATTERS

********************************************/
	
	/********************************************
	TAB INDEX
		- 	Allows <a> elements without an href to be tab-able
	********************************************/
	$(document).ready(function(){

		$('a[tabindex]').each(function(){
			$(this).addClass('--hm_manual_tab_index');
			var message = "Manual tab-index on page. You should double check it. Search for '--hm_manual_tab_index'.";
			$('html').hm_console_log(message);
		});

		$('a:not(a[href])').each(function(){
			$(this).attr('tabindex', '0');
			//console.log('tab index added');
		});

		$('a[href="#"]').each(function(){
			$(this).attr('tabindex', '0');
			//console.log('tab index added');
		});
	});

	/********************************************
	LINK TARGET="_BLANK"
		- 	Scans page for links that lead outside the site and 
			automatically sets them to open in a new tab.
	********************************************/
	$(document).ready(function(){
		$('a[href]').each(function(){
			var href = $(this).attr('href');
			var target = $(this).attr('target');
			if (href.startsWith('/') || href.startsWith('#')) {
				//do something
			} else {
				$(this).attr('target', '_blank');
				//console.log('absolute link caught');
			}
		})
	});

	/********************************************
	LINK REL="NOOPENER"
		- 	This code sets rel="noopener" for all links with target="_blank"
			This keeps the new page isolated from the first page, which is more secure
			and keeps resources freed up.  Works in conjunction with the TARGET code above.
	********************************************/
	$(document).ready(function(){
		
		$('a[target="_blank"]').attr('rel','noopener');

		$('a[target="_blank"]').each(function(){
			var rel = $(this).attr('rel');
			if (href.startsWith('/') || href.startsWith('#')) {
				//do something
			} else {
				$(this).attr('rel','noopener');
			}
		});
	});




/********************************************

VISUAL-BASED TOOLS

********************************************/

	/********************************************
	MOBILE THUMB ZONE
	********************************************/
	$(document).ready(function(){

		//HTML & CSS
			var img = "url('data:image/jpeg;base64,')";

			var html = '\
				<div id="--hm_thumb_zone"></div>\
			';

			var css ='\
			<style>\
				#--hm_thumb_zone{\
					background-image:'+img+';\
					background-size:cover;\
					background-position:center center;\
					mix-blend-mode: multiply;\
					position: fixed;\
					top:0px;\
					left:0px;\
					height:100vh;\
					width:100vw;\
					opacity:80%;\
					pointer-events: none;\
					z-index:999999999999;\
				}\
			</style>\
			';

		//Function
		$.fn.hm_thumb_zone = function() {
			$('html').append(html);
			$('html').append(css);
		};

		

	});

